import './App.css';
import React, {Component} from 'react';
import Header from './components/Header';
import Product from './components/Product';

class App extends Component{
  constructor() {
    super()
    this.state = { display: true }
  }
  render(){
    const isNone = this.state.display;
    return(
      <div>
        <Header></Header>
        <div className="row" on>
          <div className="col-xs-5 col-sm-5 col-md-5 col-lg-5" style={{ display: isNone ? 'BLOCK' : 'NONE' }}>
            <Product></Product>
          </div>
        </div>

      </div>

    )
  }
}



export default App;
